2016年カラーキャンペーンのテーマは”差し色”暮らしに彩りを与えるアクセントカラー☆<br>
衣類や小物収納に便利なチェストです。<br>
中身が見えるクリアタイプで、シーンを選ばず使えるシンプルなチェストです。<br>
重ねた状態で引出しを引いた時の本体の傾き・持ち上がりを、天面に施した前倒れ防止加工が防ぎます。<br><br>●商品サイズ（cm）：幅約37.6×奥行約52.8×高さ約19.7<br>
●引出内寸（cm）：幅約32.5×奥行約46.3×高さ約15<br>
